const part1 = () => {
    return reactedLength(Array.from(input));
};

const part2 = () => {
    const chars = Array.from(input);
    const charSet = new Set(chars.map(char => char.toUpperCase()));
    const reactLengthArray = [...charSet].map(filteredChar =>
        reactedLength(chars.filter(char => char.toUpperCase() !== filteredChar)));
    return Math.min(...reactLengthArray);
};

const reactedLength = (chars) => {
    let deleted;
    do {
        deleted = false;
        for (let i = 0; i < chars.length; i++) {
            const char = chars[i];
            if (i !== chars.length - 1) {
                const nextChar = chars[i + 1];
                if (char !== nextChar && char.toUpperCase() === nextChar.toUpperCase()) {
                    chars.splice(i, 2);
                    deleted = true;
                }
            }
        }
    } while (deleted);
    return chars.length;
};

